import {BrowserRouter,Routes,Route} from "react-router-dom";
import Login from "./Project page/Login";
import Request from "./Project page/Request";
import ServiceRequest from "./Project page/ServiceRequest";
function App() {
  return (
    <>
    <BrowserRouter>
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/request" element={<Request />} />
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
